import { Menu, Input } from 'antd';

const AppLayout = () => {
    return (
        <div>
            <Menu>
                <Menu.item key="home">Nodebird</Menu.item>
                <Menu.item key="profile">profile</Menu.item>
                <Menu.item key="mail">
                    <Input.Search enterButton />
                </Menu.item>
            </Menu>
            {children}
        </div>
    );
};

export default AppLayout;
